import { useQuery } from "@tanstack/react-query";
import { getUserFortune } from "@/apis/luck/luckAPI";

const useUserFortune = (isLogin: string) => {
  const { data } = useQuery(
    ["userFortune"],
    () => {
      return getUserFortune();
    },
    {
      enabled: Boolean(isLogin),
      suspense: false,
    }
  );
  return data;
};

export { useUserFortune };
